import React from "react";
import graphql from "babel-plugin-relay/macro";
import ListComponent from './List'
import {
  RelayEnvironmentProvider,
  loadQuery,
  usePreloadedQuery,
} from "react-relay/hooks";
import env from "../RelayEnvironment";
import {
  Button,
  Container,
  Box,
  Typography,
  CircularProgress,
} from "@mui/material";

const { Suspense } = React;

const RepositoryNameQuery = graphql`
  query HomeRepositoryNameQuery($usr: String!) {
    user(login: $usr) {
      repositories(first: 100, orderBy: { field: CREATED_AT, direction: DESC }) {
        nodes {
          name
          description
          collaborators(first: 10) {
            nodes {
              name
            }
          }
          issues(first: 10, orderBy: { field: CREATED_AT, direction: DESC }) {
            nodes {
              __typename
            }
          }
          createdAt
          url
        }
      }
    }
  }
`;

const preloadedQuery = loadQuery(env, RepositoryNameQuery, {
  usr: localStorage.getItem("user"),
});

function Home(props) {
  const data = usePreloadedQuery(RepositoryNameQuery, props.preloadedQuery);

  const signOut = () => {
    localStorage.clear();
    window.location = "/";
  };

  return (
    <div id="home" key='user.displayname'>
    <Container fluid>
      {data ? (
        <Box>
         <Box sx={{display:"flex" ,  flexDirection:"row" , justifyContent:"space-between" , alignItems:"center" }}>
         <Typography
            color="#757575"
            my={5}
            variant="h2"
          >
            Repositories
          </Typography>
          <Button size="large" variant="text" onClick={signOut}>
            Sign Out
          </Button>
         </Box>
         <hr/>
         <br />
          <Box
            sx={{
              display: "flex",
              flexDirection: "row",
              flexWrap: "wrap",
              justifyContent: "space-between",
              alignItems: "stretch",
            }}
          >
            <ListComponent data={data?.user?.repositories?.nodes}/>
          </Box>
        </Box>
      ) : (
        <h1>no data found</h1>
      )}
    </Container>
    </div>
  );
}

function HomeRoot(props) {
  return (
    <RelayEnvironmentProvider environment={env}>
      <Suspense
        fallback={
          <Box
            sx={{
              value: "user.id",
              display: "flex",
              flexDirection: "row",
              justifyContent: "center",
              alignItems: "center",
              height: "100vh",
            }}
          >
            <CircularProgress color="inherit" />
          </Box>
        }
      >
        <Home preloadedQuery={preloadedQuery} />
      </Suspense>
    </RelayEnvironmentProvider>
  );
}

export default HomeRoot;
